import React, { Component } from 'react';
// import logo from './logo.svg';
import './App.css';
import facebookIcon from './icons/facebook.png';
import githubIcon from './icons/github.png';
import linkedinIcon from './icons/linkedin.png';
import wordpressIcon from './icons/wordpress.png';
import emp from "./background-images/emp.jpg";

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      //repeater: null,
    }
  }


  changeFont() {
    let speed = 50;
    let fonts = ["https://fontmeme.com/permalink/190105/34666c4990fb8a12c872269f5a64f200.png", // doodle
                 "https://fontmeme.com/permalink/190105/b861b9e0f248b04187673a06cafdcf51.png", // comics
                 "https://fontmeme.com/permalink/190105/d20c7c83635b87feaa88b3661e570380.png", // nouveau
                 "https://fontmeme.com/permalink/190105/eb4fe1a3f0fb6a10789edf6731d479d0.png", // typewriter
                 "https://fontmeme.com/permalink/190105/b0d4913c55ec53f29810bdd00be8f0b9.png", // magna carta
                 "https://fontmeme.com/permalink/190105/2b8b0b797dc611821e286c54458e6174.png", // carnival
                 "https://fontmeme.com/permalink/190105/acf660a71f3f5e531a6fc33ec3b8d393.png", // blocky
                 "https://fontmeme.com/permalink/190105/90578442b3276021f5f32bbc0d61e3f5.png", // 8-bit
                ];
    let name = document.getElementById("name");
    let randomFont = Math.floor(Math.random() * fonts.length);
    name.setAttribute("src", fonts[randomFont]);
  }

  render() {
    let repeater = null;

    // onMouseOver={ this.setState({repeater: setInterval(this.changeFont(), 100) })}
    return (
      <div>
        <ul className="header">
          <img id="name" src="https://fontmeme.com/permalink/190105/5174451d732da03dbd43c02a8af6c46b.png" border="0" onClick={repeater = setTimeout(this.changeFont, 100)} ></img>
          <h4 style={{float: 'right'}} className="sub-heading">Resume</h4>
          <h4 style={{float: 'right'}} className="sub-heading">Project</h4>
        </ul>
        <div className="coverImage">
          <img src={emp}></img>
        </div>
        <br></br>
        <div className="body">
          <h3>Hello!</h3>
          <p>My name is Trey Tamaki! I am a fourth-year student at the University of Washington, Seattle Campus.</p>
          <p>I am getting my B.S. in Computer Science with a minor in Art History with an intended graduation in Spring 2020.</p>
        </div>
        <div className="footer">
          <div className="icon-box">
            <h6 style={{float: 'left'}}>Trademark: Trey Tamaki 2019</h6>
            <a href="https://www.facebook.com/treytamaki"><img src={facebookIcon} className="icon"></img></a>
            <a href="https://github.com/treytamaki"><img src={githubIcon} className="icon"></img></a>
            <a href="https://www.linkedin.com/in/treytamaki/"><img src={linkedinIcon} className="icon"></img></a>
            <a href="https://treytamaki.wordpress.com/"><img src={wordpressIcon} className="icon"></img></a>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
